import React from 'react'

function WaveDisplay() {
  return (
    <div className='WaveDisplay'>
      This is text
    </div>
  )
}


export default function ExportView() {
  return (
    <div className='ExportView'>
        <WaveDisplay/>
    </div>
  )
}
